import '../src/styles/App.css';
import React, { Component } from 'react';
import uniqid from 'uniqid';
import Information from './components/generalInformation';

class App extends Component {
  constructor(){
    super();
    this.state = {
      info: { 
        name: "", 
        email: "",
        phone: "",
        school: "",
        study: "",
        studyDate: "",
        company: "",
        position: "",
        description: "",
        dateFrom: "",
        dateUntil: "",
        id: uniqid() 
      },
    };
  }

  handleChange = (e) => {
    this.setState({
      info: {
        name: e.target.name,
        email: e.target.email,
        phone: e.target.phone,
        school: e.target.school,
        study: e.target.study,
        studyDate: e.target.studyDate,
        company: e.target.company,
        position: e.target.position,
        description: e.target.description,
        dateFrom: e.target.dateFrom,
        dateUntil: e.target.dateUntil,
        id: this.state.info.id,
      },
    });
  };

  onSubmitInfo = (e) => {
    e.preventDefault();
    this.setState({
      info: {
        name: this.state.info.name, 
        email: this.state.info.email,
        phone: this.state.info.phone,
        school: this.state.info.school,
        study: this.state.info.study,
        studyDate: this.state.info.studyDate,
        company: this.state.info.company,
        position: this.state.info.position,
        description: this.state.info.description,
        dateFrom: this.state.info.dateFrom,
        dateUntil: this.state.info.dateUntil,
        id: this.state.info.id,
      }
    });
  };

  render(){
    const info = this.state;

    return (
      <>
        <form className="cv-form" onSubmit={this.onSubmitInfo}>
          <section className='general-information'>
            <div> 
              <label htmlFor="nameInput">Name</label>
              <input value={info.name} id="nameInput" name="name" type="text"></input>
            </div>

            <div>
              <label htmlFor="email">Email</label>
              <input value={info.email} id='emailInput' name="email" type="email"></input>
            </div>

              <label htmlFor="phone">Phone Number</label>
              <input value={info.phone} id="phoneInput" name="phone" type="tel"></input>
              <small>Format: 123-456-7890</small>
          </section>

          <section className='educational-information'>
            <label htmlFor="schoolName">School Name</label>
            <input value={info.school} id="schoolInput" name="schoolName" type="text"></input>

            <label>Title of Study</label>
            <input value={info.study} type="text"></input>

            <label>Date of Study</label>
            <input value={info.studyDate} type="date"></input>
          </section>

          <section className='work-information'>
            <label>Company Name</label>
            <input value={info.company} type="text"></input>

            <label>Position Title</label>
            <input value={info.position} type="text"></input>

            <label>Description of your contributions</label>
            <textarea value={info.description} type="text"></textarea>

            <label>From</label>
            <input value={info.dateFrom} type="date"></input>

            <label>Until</label>
            <input value={info.dateUntil} type="date"></input>
          </section>

          <button type="submit">Submit</button>
        </form>
        <Information infos={info}/>
      </>
    );
  }
}

export default App;
